  return (
    <header className="site-header">
      <Link to="/">
        <img src="/path_to_your_logo/logo.png" alt="Logo" className="logo" />
      </Link>
      <nav>
        {/* You can add additional navigation links here if needed */}
      </nav>
    </header>
  );
};

export default Header;
